pragma solidity >=0.4.21 <0.7.0;
pragma experimental ABIEncoderV2;

import "../node_modules/openzeppelin-solidity/contracts/math/SafeMath.sol";
import '../node_modules/openzeppelin-solidity/contracts/ownership/Ownable.sol';

contract PriorIncidents is Ownable {

    using SafeMath for uint256;

    struct Location {
        string streetNumber;
        string street;
        string city;
        string state;
        string zipCode;
        string storeNumber;
    }

    struct PriorIncident {
        string date;
        string fallType;
        string attorneyName;
    }

    PriorIncident[] public priorIncidents;
    Location[] public locations;
    string[] public listCompanies;
    mapping (uint => string) public companies;
    mapping (uint => uint) companyLocationCount;
    mapping (uint => uint) companyIncidentCount;
    mapping (uint => uint) incidentToLocation;
    mapping (uint => uint) locationToCompany;
    mapping (uint => uint) locationIncidentCount;

    event createdCompany(string name, uint id);
    event createdLocation(  string streetNumber,
                            string street,
                            string city,
                            string state,
                            string zipCode,
                            string storeNumber,
                            uint companyId, uint id
                        );
    event createdPriorIncident(string date, string fallType, string attorneyName, uint locationId, uint id);

    function createCompany(string memory _name) public {
        uint id = listCompanies.push(_name) - 1;
        companies[id] = _name;
        emit createdCompany(_name, id);
    }

    function createLocation(string memory _streetNumber,
                            string memory _street,
                            string memory _city,
                            string memory _state,
                            string memory _zipCode,
                            string memory _storeNumber,
                            uint _companyId
    ) public {
        uint locationId = locations.push(Location(_streetNumber, _street, _city, _state, _zipCode, _storeNumber)) - 1;
        companyLocationCount[_companyId] = companyLocationCount[_companyId].add(1);
        locationToCompany[locationId] = _companyId;
        emit createdLocation(_streetNumber, _street, _city, _state, _zipCode, _storeNumber, _companyId, locationId);
    }

    function createPriorIncident(string memory _date,
                                string  memory _fallType,
                                string  memory _attorneyName,
                                uint    _locationId
    ) public {
        uint incidentId = priorIncidents.push(PriorIncident(_date, _fallType, _attorneyName)) - 1;
        uint companyId = locationToCompany[_locationId];
        companyIncidentCount[companyId] = companyIncidentCount[companyId].add(1);
        incidentToLocation[incidentId] = _locationId;
        locationIncidentCount[_locationId] = locationIncidentCount[_locationId].add(1);
        emit createdPriorIncident(_date, _fallType, _attorneyName, _locationId, incidentId);
    }

    function getLocationsByCompany(uint _companyId) public view returns (uint[] memory) {
        uint[] memory result = new uint[](companyLocationCount[_companyId]);
        uint counter = 0;
        for (uint i = 0; i < locations.length; i++) {
            if (locationToCompany[i] == _companyId) {
                result[counter] = i;
                counter = counter.add(1);
            }
        }
        return result;
    }

    function getPriorIncidentsByLocation(uint _locationId) public view returns (uint[] memory) {
        uint[] memory result = new uint[](locationIncidentCount[_locationId]);
        uint counter = 0;
        for (uint i = 0; i < priorIncidents.length; i++) {
            if (incidentToLocation[i] == _locationId) {
                result[counter] = i;
                counter = counter.add(1);
            }
        }
        return result;
    }

    function getPriorIncidentsByCompany(uint _companyId) public view returns (uint[] memory) {
        uint[] memory result = new uint[](companyIncidentCount[_companyId]);
        uint counter = 0;
        for (uint i = 0; i < priorIncidents.length; i++) {
            if (locationToCompany[incidentToLocation[i]] == _companyId) {
                result[counter] = i;
                counter = counter.add(1);
            }
        }
        return result;
    }
    function getLocations() public view returns (Location[] memory) {
        return locations;
    }

    function getCompanyLocationCount(uint _companyId) public view returns (uint) {
        return companyLocationCount[_companyId];
    }
    function getLocationByIndex(uint _locationId) public view returns (Location memory) {
        return locations[_locationId];
    }

    function getNumIncidentsByCompany(uint _companyId) public view returns (uint) {
        return companyIncidentCount[_companyId];
    }

    function getNumIncidentsByLocation(uint _locationId) public view returns (uint) {
        return locationIncidentCount[_locationId];
    }

    function getLocationByIncident(uint _incidentId) public view returns (uint) {
        return incidentToLocation[_incidentId];
    }

    function getPriorIncidentByIndex(uint _incidentId) public view returns (PriorIncident memory) {
        return priorIncidents[_incidentId];
    }

    function listAllCompanies() public view returns (string[] memory) {
        return listCompanies;
    }

    function getCompany(uint _companyId) public view returns (string memory) {
        return listCompanies[_companyId];
    }


    function getCompanyByPriorIncident(uint _incidentId) public view returns (string memory) {
        uint locationId = incidentToLocation[_incidentId];
        return companies[locationToCompany[locationId]];
    }

    function getLocationByPriorIncident(uint _incidentId) public view returns (Location memory) {
        uint locationId = incidentToLocation[_incidentId];
        return locations[locationId];
    }

}
